import React from 'react';

const Navbar = () => {
    return(
        <nav className ='navbar navbar-nav shadow justify-content: left'>
            <li>Home</li>
            <li>Search</li>
            <li>Tweets</li>
        </nav>
    );
}

export default Navbar;
